def calculate_risk_level(davis, davis_security):
    if 'implementing' in davis and 'security' in davis:
        risk_factor = 1.5
    elif 'follow' in davis and 'institutions' in davis and 'policies' in davis:
        risk_factor = 1
    else:
        return "Insufficient information"

    if 'implementing' in davis_security and 'safeguarding' in davis_security:
        security_factor = 2
    elif 'follow' in davis_security and 'institutions' in davis_security and 'policies' in davis_security:
        security_factor = 1.5
    else:
        return "Insufficient information"

    risk_level = risk_factor * (1 - security_factor)
    if risk_level < 0.2:
        return "The security non-compliance risk level is low."
    elif risk_level > 0.9:
        return "The security non-compliance risk level is high."
    else:
        return "The security non-compliance risk level is moderate."
```

